  \"2015-04-14T10:55:55.907771\",\n\t\"name\": \"national-land-cover-database-nlcd-land-cover-collection\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The National Land Cover Database (NLCD)
  Land Cover Collection is produced through a cooperative project conducted by the
  Multi-Resolution Land Characteristics (MRLC) Consortium (www.mrlc.gov). The MRLC
  Consortium is a partnership of Federal agencies, consisting of the U.S. Geological
  Survey, the National Oceanic and Atmospheric Administration, the U.S. Environmental
  Protection Agency, the U.S. Department of Agriculture (USDA) National Agricultural
  Statistics Service, the U.S. Forest Service, the National Park Service, the U.S.
  Fish and Wildlife Service, the Bureau of Land Management, NASA, and the U.S. Army
  Corps of Engineers. A primary goal of the MRLC Consortium is to generate current,
  consistent, and seamless national datasets of land cover, percent developed imperviousness,
  and percent tree canopy. NLCD 2001 land cover was created by partitioning the conterminous
  United States into 66 mapping zones, based on ecoregion and geographical characteristics,
  edge matching features, and the size requirement of Landsat mosaics. NLCD 2001 represents
  a seamless assembly of land cover for all 66 MRLC mapping zones. NLCD 2001 land
  cover was developed for all 50 states and Puerto Rico / U.S. Virgin Islands. NLCD
  2006 land cover was created on a path/row basis and mosaicked to create a seamless
  national product. NLCD 2006 land cover was developed for the conterminous United
  States. NLCD 2011 land cover was created on a path/row basis and mosaicked to create
  a seamless national product. The data in NLCD 2011 are completely integrated with
  NLCD 2001 and NLCD 2006. As part of the NLCD 2011 project, the NLCD 2001 and 2006
  land cover data products were revised and reissued to provide full compatibility
  with the new NLCD 2011 products. NLCD 2011 land cover was developed for the conterminous
  United States and Alaska. Questions about the NLCD Land Cover Collection can be
  directed to the NLCD land cover mapping team at USGS EROS, Sioux Falls, SD (605)
  594-6151 or mrlc@usgs.gov.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
